import { Box, Typography } from "@mui/material";
import React from "react";

function PlayStore() {
  return (
    <Box
      sx={{
        display: "grid",
        maxWidth: "120%",
        margin: "0 auto",
        padding: 0,
        height: "600px",
        backgroundColor: "#e3f2fd",
        marginTop: "100px",
        textAlign: "start", // Aligns text center
      }}
    >
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          fontSize: "2.9rem",
          fontWeight: "700",
          lineHeight: 1.2,
          padding: "55px",
          letterSpacing: "0.015em",
          wordSpacing: "0.001em",
        }}
      >
        Download the{" "}
        <Box
          component="span"
          sx={{
            color: "#3593b0",
            position: "relative",
            display: "inline-block",
            "&::after": {
              content: '""',
              position: "absolute",
              left: 40,
              bottom: "-8px",
              width: "89%",
              height: "4px",
              backgroundColor: "black",
              borderRadius: "5px",
            },
          }}
        >
          MyMoneyMantra
        </Box>
        <br />
        Mobile App
      </Typography>
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          display: "flex",
          fontSize: "25px",
          fontWeight: "600px",
          color: "black",
          marginBottom:'220px',
          marginLeft:'50px'
        }}
      >
        <ul
          style={{
            listStyleType: "none",
            padding: 0,
            margin: 0,
            lineHeight: "1.6",
          }}
        >
          <li>Enjoy a seamless experience.</li>
          <li>Get exclusive Loans and Credit Card offers.</li>
          <li>Track your credit score anytime anywhere</li>
        </ul>
      </Typography>
    </Box>
  );
}

export default PlayStore;
